    void predict(double s[], double th) {

        int SIZE = s.length;
        double t[] = new double[SIZE];
        double var[] = new double[SIZE];

        int j = 0, k = 5, sum = 0, i = 0;
        float avg = 0;

        while (j < SIZE) {

            while (j < k) {
                sum += s[j];
                avg = sum / k;
                j++;
            }
            k++;
            t[i] = avg;
            i++;
        }

        i = 0;j = 0;k = 5;

        float acc = 0, vari = 0;

        while (j < SIZE) {

            while (j < k) {

                acc += ((s[j] - t[i]) * (s[j] - t[i]));
                j++;
            }

            vari = acc / k;

            k++;
            var[i] = vari;
            Log.d("Radio Button", "Selected:" + vari);
            acc = 0;

            i++;

        }


        int count = 0;
        for (int z = 0; z < i; z++) {
            if (var[z] > th) {
                count++;
            }
            Log.d("Radio Button", "Selected:" + var[z]);
        }
        DisplayMetrics dm = new DisplayMetrics();
        getWindowManager().getDefaultDisplay().getMetrics(dm);

        int width = dm.widthPixels;
        int height = dm.heightPixels;

        getWindow().setLayout((int) (width * 0.5), (int) (height * 0.5));
        TextView textView = (TextView) findViewById(R.id.textViewpredict);
        textView.setText(count + " Bradicardia Predicted!");

    }

    public void var_predict(double s[]) {
        int i = 0, j = 0;
        double sumOfWindow1, sumOfWindow2, mean1, mean2;

        ArrayList<Double> window1 = new ArrayList<Double>();
        ArrayList<Double> window2 = new ArrayList<Double>();
        ArrayList<Double> va1 = new ArrayList<Double>();
        ArrayList<Double> va2 = new ArrayList<Double>();
        ArrayList<Double> var_diff = new ArrayList<Double>();

        for (i = 10; i < s.length; i++) {
            for (j = 1; j <= 5; j++) {
                if (j <= 5) {
                    window1.add(s[i - j]);
                }
            }
            for (j = 6; j <= 10; j++) {

                if (j > 5) {
                    window2.add(s[i - j]);
                }

            }
            sumOfWindow1 = 0;
            sumOfWindow2 = 0;
            for (j = 0; j < 5; j++) {
                sumOfWindow1 += window1.get(j);
                sumOfWindow2 += window2.get(j);
            }

            mean1 = sumOfWindow1 / 5;
            mean2 = sumOfWindow2 / 5;


            double sq_value1 = 0, sq_value2 = 0;
            for (j = 0; j < 5; j++) {

                sq_value1 = sq_value1 + ((window1.get(j) - mean1) * (window1.get(j) - mean1));
                sq_value2 = sq_value2 + ((window2.get(j) - mean2) * (window2.get(j) - mean2));

            }
            sq_value1 = sq_value1 / 5;
            sq_value2 = sq_value2 / 5;
            va1.add(sq_value1);
            va2.add(sq_value2);

            window1 = new ArrayList<Double>();
            window2 = new ArrayList<Double>();

        }

        // Calculate threshhold
        System.out.println("variance 1:  " + va1);
        System.out.println("\n\n variance 2:   " + va2);
        double x = 0;
        int count_predict = 0;
        for (i = 0; i < va1.size(); i++) {
            x = va1.get(i) - va2.get(i);
            if (x > 600) {
                count_predict = count_predict + 1;
            }
            x = 0;
        }

        double diff;
        for (i = 0; i < va1.size(); i++) {
            diff = 0;
            diff = va1.get(i) - va2.get(i);
            var_diff.add(diff);

        }
        System.out.println("diff variance:  " + var_diff);
        double diff_sum = 0;
        for (i = 0; i < var_diff.size(); i++)
            diff_sum = diff_sum + var_diff.get(i);

        System.out.println("diff avg threshold:  " + diff_sum);
        System.out.println("count is : " + count_predict + "size : " + va1.size());

        for (i = 0; i < va1.size(); i++) {
            x = va1.get(i) - va2.get(i);
            if (x > 600) {
                count_predict = count_predict + 1;
            }
            x = 0;
        }
    }



